class Solution:
    def maxOperations(self, s: str) -> int:
        ones_seen = 0
        res = 0
        for i, c in enumerate(s):
            if s[i] == "0" and (i + 1 == len(s) or s[i + 1] == "1"):
                res += ones_seen
            if s[i] == "1":
                ones_seen += 1

        return res
